let CHART_INSTANCES=[];const CHART_RESIZE_OBSERVER=new ResizeObserver(()=>{CHART_INSTANCES.forEach(({chart:n})=>{n.resize()})});window.EChartInitialized=(n,t)=>{const i=echarts.init(document.getElementById(`${n}`));i.setOption(JSON.parse(t));CHART_INSTANCES.push({domId:n,chart:i});CHART_RESIZE_OBSERVER.observe(i.getDom())};window.EChartDispose=n=>{CHART_RESIZE_OBSERVER.disconnect(CHART_INSTANCES.find(t=>t.domId===n).chart.getDom()),CHART_INSTANCES=CHART_INSTANCES.filter(t=>t.domId!=n)};